import {
    CREATE_PROFILE,
} from './types'

export const createProfile = (event, {
    firstName,
    lastName,
    email,
    company,
    website,
    location,
    skills,
    gitHub,
    bio,
    linkedIn,
    youtube,
}) => dispatch => {
    event.preventDefault()
    const profile = {
        firstName,
        lastName,
        email,
        company,
        website,
        location,
        skills,
        gitHub,
        bio,
        linkedIn,
        youtube,
    };
    console.log(profile);
    dispatch({
        type: CREATE_PROFILE,
        payload: profile
    })
}
